import logo from './logo.svg';
import './App.css';
import {
  Routes ,
  Route,
  Link
} from "react-router-dom";

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Admin <code>Sales</code> and Social APP.
        </p>


          <Link to="/">Home</Link>

      </header>

      <Routes>
          <Route path="/Home" element={<Home/>} />
          </Routes>
    </div>

  );
}

export default App;

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
